import {gql} from'@apollo/client';

export const GET_GRAPH = gql`
{
  nfts(orderBy: totalSales, orderDirection: desc) {
    tokenId
    uri
    totalSales
    totalSalesWei
    avgSaleWei
    totalTransfers
    block
    hash
  }
}
`
